import { useEffect, useState } from 'react';

function App() {

  const [commands, setCommands] = useState(null)

  const fetchData = () => {

    setTimeout(() => {
      fetch("http://localhost:5000/api/command/all", {method: "GET"})
      .then(res => res.json())
      .then( res => setCommands(res))

      console.log("hola")
    }, 1000);
  }

  useEffect(fetchData , [])



  const Command = (props) => (
    <div> 
     <ul>
       <li>Cocina: {props.command.kitchen}</li>
       <li>Fecha: {props.command.date}</li>
       <li>Hora: {props.command.time}</li>
       <li>Mozo: {props.command.waiter}</li>
       <li>Mesa: {props.command.table}</li>
     </ul>
    </div>
  )  

  return (
    <div className="App">
      <h1>hola</h1>
      {commands ? commands.map(command => <Command  command={command}/>) : <></>}
      <button onClick={fetchData} >Fetch</button>
    </div>
  );
}

export default App;
